import React from 'react';
import styled from '@emotion/styled';

const Link = styled.a `
  text-decoration: none;
  color: #2e65ff;

`;

function Navbar() {
    return (
        <React.Fragment>
            <ul>
                <li>About</li>
                <li>Info</li>
                <li>Projects</li>
            </ul>
        </React.Fragment>
    );
}
export default Navbar;
